import React from "react";
import { useNavigate } from "react-router-dom";

function Booking(){
    const navigate=useNavigate();
    return (
        <>
        <div>Order</div>
        <button onClick={()=> navigate('Movie')}>Go back</button>
        </>
    )
}

export default Booking;
